import React from 'react';
import './App.css';

function handleSubmit() {
  return (
    <div>
      <span>Value is sent</span>
    </div>
  )
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        Sarcasm Detector
      <div>
          <form onSubmit={handleSubmit}>
            <input type='text' name='title' />
          </form>
        </div>
      </header>
    </div>
  );
}

export default App;
